// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./ERC721WithIERC1155.sol";

contract ROCNFT2 is ERC721WithIERC1155, Ownable, AccessControl, Pausable {
    bytes32 public constant URI_SETTER_ROLE = keccak256("URI_SETTER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    constructor() ERC721WithIERC1155("Rise of Cats", "ROC", "https://nft.riseofcats.com/cat/") {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(URI_SETTER_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
    }

    function setURI(string memory newuri) public onlyRole(URI_SETTER_ROLE) {
        _setURI(newuri);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function mint(address account, uint256 id, bytes memory data)
    public
    onlyRole(MINTER_ROLE)
    {
        _safeMint(account, id, data);
    }

    function mintBatch(address to, uint256[] memory ids)
    public
    onlyRole(MINTER_ROLE)
    {
        _mintBatchERC721(to, ids);
    }


    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    )
    internal
    whenNotPaused
    override
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
    public
    view
    override(ERC721WithIERC1155, AccessControl)
    returns (bool)
    {
        return ERC721WithIERC1155.supportsInterface(interfaceId) || AccessControl.supportsInterface(interfaceId);
    }
}
